div.script:
$(document).ready(function(){
    var obj = "#tabs_3";
    var tabTemp = '<li><a href="#{href}">#{label}</a><img width="12px" src="img/empty.gif" class="op_list" onclick="showList(this, \''+obj+'\', \'#{href}\')" /></li>';
    $(obj).tabs({ 
        tabTemplate: tabTemp,
        show: function(event, ui){
            updateThumbs();
        },
        select: function(event, ui){
            changingTab=true;
        }
    });

});
